INSERT INTO `product` (`pid`, `bid`, `s_cid`, `pimage`, `pname`, `descr`, `spec`, `pkgu`, `pqty`, `pkgs`, `pkgp`, `price`, `dis`, `oprice`) VALUES
(1, 1, 1, 'britannia_rusk_22_02_2017_Britannia_Rusk.jpg', 'Britannia Bake Rusk (Toast), 63g Pouch', 'Make your tea time crispy and rusky with amazingly delicious Britannia Premium Bake Rusk. The taste of it makes you go irresistible. Britannia Premium Bake Rusk biscuits provide best nutrition to your health.', 'Wheat Flour(71%), Wheat Fibre, Sugar, Edible Vegetable Oil, Milk Solids, Salt, Suji, Yeast, Invert Syrup, Butter, Emulsifier (471), Flour Treatment Agent (1100), Spices(Cardamom & Its Oil - 0.09%) and Antioxidant (300) (per 10 g) Calories: 45 kcal Sodium: 0 mg Total Fat: 1 g Potassium: 0 mg Saturated: 0 g Total Carbs: 7 g Polyunsaturated: 0 g Dietary Fiber: 0 g Monounsaturated: 0 g Sugars: 2 g Trans: 0 g Protein: 1 g Cholesterol: 3 mg', '200 Gram', '25', 'GRAM', 'POUCH', 10, 0, 10),
(2, 24, 1, 'parle_rusk_22_02_2017_parle_rusk.jpg', 'Parle Rusk - Real Elaich, 200g Pouch', 'Rusk is a hard twiced baked bread, It was originally discovered to preserve bread during the dry weather, The best way to relish this Crispy tea-time snack is to eat if after dipping it in tea or coffee.', 'Wheat Flour, Sugar, Edible Vegetable Oil, Yeast, Milk Solids, Salt, Butter, Wheat Gluten, [Lecithin of Soya Origin (Sodium Stearoy-2-Lactylates, Tartaric Acid Esters of Mono and Di-Glycerides, Mono & Fatty Acids) of Edible Vegetable Oils], Wheat Fibre, [Cardamom (0.08%), Antioxidant [300], Improver [1100].\r\nAmount Per 100 g (Approx), Carbohydrate 79.4g, of Which Sugars 24.4g, Protein 7.6g, Fat 9.5g, Saturated Fat not more than 5.2g, Trans Fat Not more than 0.03g, Energy 434 Kcal.', '200', '23', 'GRAM', 'POUCH', 30, 0, 30),
(3, 4, 18, 'Amul Kool - Badam, 200 ml Pet_05_04_2017_Badam_Flavoured_Milk.jpg', 'Amul Kool - Badam, 200 ml Pet', 'Amul Kool Badam is made up with 100 % pure natural ingredients and with richness of milk. The refreshing drink can be enjoyed anywhere it may be at home, party or in picnic. It contains calcium, protein, carbohydrates, vitamins, added sugar, etc.\r\n\r\n', 'Composition	Sterilized Homogenized Flavored Toned Milk & Sugar\r\nNutritional Information	Nutritional Information*\r\nAmount per 100 ml\r\nEnergy, kcal	89\r\nEnergy from Fat, kcal	28\r\nTotal Fat, g	3.1\r\nSaturated fat,g	1.9\r\nCholesterol, mg	8.3\r\nSodium, mg	50\r\nTotal Carbohydrate, g	12\r\nAdded Sugar, g	8\r\nProtein, g	3.2\r\nNot a significant source of Dietary fiber, Vitamin C and Iron.\r\n*Approx. values\r\n\r\nShelf Life	180 days when stored in cool and dry place\r\nStorage condition	Ambient\r\n', '200', '25', 'ML', 'PET BOTTLE', 20, 0, 20),
(4, 4, 18, 'Amul Kool - Elaichi, 200 ml_05_04_2017_Elaichi_Flavoured_Milk.jpg', 'Amul Kool - Elaichi, 200 ml', 'Amul Kool Elaichi is refreshing milk with taste of Cardamom (Elaichi). It is an easy to use tasty drink that refreshes you immediately with goodness of milk.\r\n\r\n', 'Composition	Sterilized Homogenized Flavored Toned Milk & Sugar\r\nNutritional Information	Nutritional Information*\r\nAmount per 100 g\r\nEnergy, kcal	89\r\nEnergy from Fat, kcal	28\r\nTotal Fat, g	3.1\r\nSaturated fat,g	1.9\r\nCholesterol, mg	8.3\r\nSodium, mg	50\r\nTotal Carbohydrate, g	12\r\nAdded Sugar, g	8\r\nProtein, g	3.2\r\nNot a significant source of Dietary fiber, Vitamin C and Iron.\r\n*Approx. values\r\n\r\nShelf Life	180 days when stored in cool and dry place\r\nStorage condition	Ambient\r\n', '200 ', '25', 'ML', 'PET BOTTLE', 20, 0, 20),
(5, 4, 18, 'Amul Kool - Kesar, 200 ml_05_04_2017_Kesar_Flavoured_Milk..jpg', 'Amul Kool - Kesar, 200 ml', 'Amul Kool Kesar is refreshing milk with taste of Saffron (Kesar). It is an easy to use delicious drink that refreshes you immediately with goodness of milk.\r\n\r\n.', 'Composition	Sterilized Homogenized Flavored Toned Milk & Sugar\r\nNutritional Information	Nutritional Information*\r\nAmount per 100 g\r\nEnergy, kcal	89\r\nEnergy from Fat, kcal	28\r\nTotal Fat, g	3.1\r\nSaturated fat,g	1.9\r\nCholesterol, mg	8.3\r\nSodium, mg	50\r\nTotal Carbohydrate, g	12\r\nAdded Sugar, g	8\r\nProtein, g	3.2\r\nNot a significant source of Dietary fiber, Vitamin C and Iron.\r\n*Approx. values\r\n\r\nShelf Life	180 days when stored in cool and dry place\r\nStorage condition	Ambient\r\n', '200 ', '25', 'ML', 'PET BOTTLE', 20, 0, 20),
(6, 4, 18, 'Amul Kool - Rose, 200 ml Pet_05_04_2017_Rose_Flavoured_Milk.jpg', 'Amul Kool - Rose, 200 ml Pet', 'Amul Kool Rose is refreshing milk with flavor of Rose. It is a simple to use tasty drink that refreshes you immediately with goodness of milk.\r\n\r\n', 'Composition	Sterilized Homogenized Flavored Toned Milk & Sugar\r\nNutritional Information	Nutritional Information*\r\nAmount per 100 g\r\nEnergy, kcal	89\r\nEnergy from Fat, kcal	28\r\nTotal Fat, g	3.1\r\nSaturated fat,g	1.9\r\nCholesterol, mg	8.3\r\nSodium, mg	50\r\nTotal Carbohydrate, g	12\r\nAdded Sugar, g	8\r\nProtein, g	3.2\r\nNot a significant source of Dietary fiber, Vitamin C and Iron.\r\n*Approx. Values\r\n\r\nShelf Life	180 days when stored in cool and dry place\r\nStorage condition	Ambient\r\n', '200', '24', 'ML', 'PET BOTTLE', 20, 0, 20),
