(35, 24, 2, 'Parle Hide & Seek Chocolate, 33g_12_03_2017_parle-hide-seek-chocolate-33g.jpg', 'Parle Hide & Seek Chocolate, 33g Pouch', 'Hide & Seek Chocolate Chip Cookies are the most popular molded chocolate chip cookie in the world. Each cookie is filled with decadent chocolate flavor. Hide & Seek Chocolate Chip Cookies are packed with delicious chocos which are not hidden in real and gets melted soon after you eating in your mouth.', '( Per 100 g) Calories 48 Sodium 0 mg Total Fat 18 g Potassium 0 mg Saturated 0 g Total Carbs 74 g Polyunsaturated 0 g Dietary Fiber 0 g Monounsaturated 0 g Sugars 32 g Trans 0 g Protein 6 g Cholesterol 0 mg', '33', '25', 'GRAM', 'POUCH', 10, 0, 10),
(36, 24, 2, 'Parle Hide & Seek Chocolate, 120g_12_03_2017_parle-hide-seek-chocolate-120g.jpg', 'Parle Hide & Seek Chocolate, 120g Pouch', 'Hide & Seek Chocolate Chip Cookies are the most popular molded chocolate chip cookie in the world. Each cookie is filled with decadent chocolate flavor. Hide & Seek Chocolate Chip Cookies are packed with delicious chocos which are not hidden in real and gets melted soon after you eating in your mouth.', '( Per 100 g) Calories 48 Sodium 0 mg Total Fat 18 g Potassium 0 mg Saturated 0 g Total Carbs 74 g Polyunsaturated 0 g Dietary Fiber 0 g Monounsaturated 0 g Sugars 32 g Trans 0 g Protein 6 g Cholesterol 0 mg', '120', '25', 'GRAM', 'POUCH', 30, 0, 30),
(37, 1, 2, 'Britannia 50-50 Maska Chaska Biscuits, 50g_12_03_2017_britannia-50-50-maska-chaska-biscuits-50g.jpg', 'Britannia 50-50 Maska Chaska Biscuits, 50g Pouch', 'Britannia 50-50 Maska Chaska is dissimilar flavor then 50-50 biscuits. It is flavored in the common American Cream and Onion style. This explosion of flavors additional to that pinch of sugariness makes the Britannia 50-50 Maska Chaska biscuit mouth wateringly delicious.', 'Wheat Flour, Edible Vegetable oil, (10.3%) Invert Syrup Milk, Solids (1.1%) Raising Agents (503 (ii), 500 (ii), 450 (ii) Salt, Emulsifiers (471, 4810) Dough Conditioner (221) Calcium Salt Vitamins, Ferrousd salt And Potassium Iodiate.', '50', '25', 'GRAM', 'POUCH', 10, 0, 10),
(38, 24, 2, 'Parle Biscuits - Monaco Salted Snack, 75.4g_12_03_2017_parle-biscuits-monaco-salted-snack-75.4g.jpg', 'Parle Biscuits - Monaco Salted Snack, 75.4g Pouch', 'Parle Monaco Salted is the perfect accompaniment to a cup of tea, especially for those who are not fond of sweet biscuits. Each biscuit is baked to perfection, is light, crunchy and coated with the adequate quantity of salt so that it can be your favorite mid-morning or evening snack.', 'Parle Monaco salted biscuit contains 67.2g of carbohydrates for every 100g of the product. This carbohydrate in turn, comprises of 22.3g fat, 7.1g sugar, 7.5g protein and provides 500kcal of energy.', '75.4', '25', 'GRAM', 'POUCH', 10, 0, 10),
(39, 24, 2, 'Parle Biscuits - Monaco Salted Snack, 150g_12_03_2017_parle-biscuits-monaco-salted-snack-150g.jpg', 'Parle Biscuits - Monaco Salted Snack, 150g Pouch', 'Parle Monaco Salted is the perfect accompaniment to a cup of tea, especially for those who are not fond of sweet biscuits. Each biscuit is baked to perfection, is light, crunchy and coated with the adequate quantity of salt so that it can be your favorite mid-morning or evening snack.', 'Parle Monaco salted biscuit contains 67.2g of carbohydrates for every 100g of the product. This carbohydrate in turn, comprises of 22.3g fat, 7.1g sugar, 7.5g protein and provides 500kcal of energy.', '150', '25', 'GRAM', 'POUCH', 25, 0, 25),
(40, 24, 2, 'Parle Krack Jack , 75.60g_12_03_2017_parle-krack-jack-75.60g.jpg', 'Parle Krack Jack , 75.60g Pouch', 'After a hectic and tiresome day, all we need is a refreshing snack to eat so that we feel fresh. In such a case, Parle krack jack biscuits are a perfect choice. Their crunchiness makes your life crisp and tasty again. The sweet and sour taste of the biscuits will make you forget your worries.', 'Parle Krack Jack Biscuit contains wheat flour, sugar, RBD palmolein, RBD palm oil, leavening [ammonium bicarbonate, sodium bicarbonate], invert syrup, salt, yeast, artificial vanilla & butter flavors, emulsifiers of vegetable origin (esters of mono and, diglycerides & sodium stearoyl-2-lactylate), skim milk powder, lactic acid, sodium meta bisulphite as preservative and mono acid calcium phosphate', '75.60', '25', 'GRAM', 'POUCH', 10, 0, 10),
(41, 1, 2, 'Parle Krack Jack, 200g_12_03_2017_parle-krack-jack-200g.jpg', 'Parle Krack Jack, 200g Pouch', 'Parle Krack Jack Biscuit is a crunchy and tasty biscuit with an ideal balance of sweetness and saltiness. Once you begin relishing it, you wonÃƒÂ¢Ã¢â€šÂ¬Ã¢â€žÂ¢t be able to end. You will desire for more. Although Krackjack sweet and salty biscuits can be enjoyed anytime, it leaves wonderfully well with your evening cup of tea.', 'Wheat flour, edible vegetable oils, sugar (16.7%), leavening agents (53 (ii), 5 (ii), 341(i)], invert syrup, salt(.9%), yeast, emulsifiers[322 or 471 and 481 (i)], acid regulators [27, 296], milk solids, dough conditioner [223], improver [amylases and other enzymes] and antioxidant [319].', '200', '25', 'GRAM', 'POUCH', 25, 0, 25),
(42, 29, 2, 'Sunfeast Dark Fantasy - Choco Fills, 75g_12_03_2017_sunfeast-dark-fantasy-choco-fills-75g.jpg', 'Sunfeast Dark Fantasy - Choco Fills, 75g Carton', 'Sunfeast Dark Fantasy Chocofill is nothing but smooth and tasty choco creme inside cookies that are baked to perfection. It has a rich chocolaty taste, and because of its soft texture, it simply melts in the mouth after a bite. This innovative cookie has its center filled with luscious chocolate which adds to the crunchiness.', 'Some of the important ingredients of this cookie are milk solids, choco cream, butter, hydrogenated edible vegetable oil, invert syrup, raising agents and sugar. There are no artificial preservatives, flavours and colours.', '75', '25', 'GRAM', 'CARTON', 30, 0, 30),
(43, 1, 2, 'Britannia Good Day Cookies - Rich Cashew, 58g_12_03_2017_britannia-good-day-cookies-rich-cashew-58g.jpg', 'Britannia Good Day Cookies - Rich Cashew, 58g Pouch', 'Combining the kindness of cookies with the crunchiness and good of cashews, Britannia Good Day rich cashew biscuits will create a delicious blast in your mouth. Great with tea/coffee or on its personal, it makes for a vast bite to share and reach joy.', 'Wheat Flour, Sugar, Vegetable Oil (Palm Oil), Butter and Skimmed Milk Powder(from Cows and/or Buffalos Milk), Cashews(5.2%), Leavening (Ammonium Bicarbonate (E503), Sodium Bicarbonate (E500), Salt, Emulsifiers (Mono Diglycerides of Vegetable origin (E471), Soya Lecithin (E322), Artificial Flavours (Butter, Vanilla, Nut) and Annatto Extract (E160b).', '58', '25', 'GRAM', 'POUCH', 10, 0, 10),
(44, 1, 2, 'Britannia Good Day Cookies - Rich Cashew, 100g_12_03_2017_britannia-good-day-cookies-rich-cashew-100g.jpg', 'Britannia Good Day Cookies - Rich Cashew, 100g Pouch', 'Combining the kindness of cookies with the crunchiness and good of cashews, Britannia Good Day rich cashew biscuits will create a delicious blast in your mouth. Great with tea/coffee or on its personal, it makes for a vast bite to share and reach joy.', 'Wheat Flour, Sugar, Vegetable Oil (Palm Oil), Butter and Skimmed Milk Powder(from Cows and/or Buffalos Milk), Cashews(5.2%), Leavening (Ammonium Bicarbonate (E503), Sodium Bicarbonate (E500), Salt, Emulsifiers (Mono Diglycerides of Vegetable origin (E471), Soya Lecithin (E322), Artificial Flavours (Butter, Vanilla, Nut) and Annatto Extract (E160b).', '100', '25', 'GRAM', 'POUCH', 20, 0, 20),
