(46, 1, 2, 'Britannia Treat - Jim Jam Biscuits, 100g_12_03_2017_britannia-treat-jim-jam-biscuits-100g.jpg', 'Britannia Treat - Jim Jam Biscuits, 100g Pouch', 'Get ready to bite into a delightful treat filled with a jam centre and sugar crystals on top! Britannia has created a perfect treat â€“ yet again. This double biscuit with its creamy, jammy centre is already a big hit with children. Britannia is a well known brand that produces popular confectionary items and even savoury snacks.', 'These biscuits contain energy, sugar, protein, vegetable oil, and carbohydrates. Wheat flour, emulsifiers, permitted preservatives, as well as milk and sugar come together to make the biscuit shells. Meanwhile, cocoa for a creamy chocolate sauce with vanilla essence, cream, jam and sugar crystals are used for the filling and the garnish.', '100', '25', 'GRAM', 'POUCH', 20, 0, 20),
(47, 1, 2, 'Britannia Treat - Jim Jam Biscuits, 150g_12_03_2017_britannia-treat-jim-jam-biscuits-150g.jpg', 'Britannia Treat - Jim Jam Biscuits, 150g Pouch', 'Get ready to bite into a delightful treat filled with a jam centre and sugar crystals on top! Britannia has created a perfect treat â€“ yet again. This double biscuit with its creamy, jammy centre is already a big hit with children. Britannia is a well known brand that produces popular confectionary items and even savoury snacks.', 'These biscuits contain energy, sugar, protein, vegetable oil, and carbohydrates. Wheat flour, emulsifiers, permitted preservatives, as well as milk and sugar come together to make the biscuit shells. Meanwhile, cocoa for a creamy chocolate sauce with vanilla essence, cream, jam and sugar crystals are used for the filling and the garnish.', '150', '25', 'GRAM', 'POUCH', 30, 0, 30),
(48, 1, 2, 'Britannia Nutri Choice - Hi Fibre Digestive Biscuits, 100g_12_03_2017_britannia-nutri-choice-hi-fibre-digestive-biscuits-100g.jpg', 'Britannia Nutri Choice - Hi Fibre Digestive Biscuits, 100g Pouch', 'Fibre is the name of the game. Britannias digestive biscuit is packed with multi grain goodness that also provides your body with essential dietary fibres. This soft and flaky biscuit is one of the products from the house of Britannia which is globally known for its high quality confectionary and other products.', 'This digestive biscuit brings you five grains packed into a 100 gram pack of high nutrition. It also contains coarse wheat flour and wheat bran which gives it a grainy texture along with oats and other ingredients like dried whey and palm oil, maltose syrup, salt, whole milk powder for that dose of calcium and protein, and raising agents and emulsifiers. This biscuit is rich in a variety of minerals and vitamins.', '100', '25', 'GRAM', 'POUCH', 20, 0, 20),
(49, 1, 2, 'Britannia Nutri Choice - Hi Fibre Digestive Biscuits, 250g_12_03_2017_britannia-nutri-choice-hi-fibre-digestive-biscuits-250g.jpg', 'Britannia Nutri Choice - Hi Fibre Digestive Biscuits, 250g Carton', 'Fibre is the name of the game. Britannias digestive biscuit is packed with multi grain goodness that also provides your body with essential dietary fibres. This soft and flaky biscuit is one of the products from the house of Britannia which is globally known for its high quality confectionary and other products.', 'This digestive biscuit brings you five grains packed into a 250 gram pack of high nutrition. It also contains coarse wheat flour and wheat bran which gives it a grainy texture along with oats and other ingredients like dried whey and palm oil, maltose syrup, salt, whole milk powder for that dose of calcium and protein, and raising agents and emulsifiers. This biscuit is rich in a variety of minerals and vitamins.', '250', '25', 'GRAM', 'CARTON', 50, 0, 50),
