(52, 1, 2, 'Britannia Good Day Cookies - Rich Butter, 35g_12_03_2017_britannia-good-day-cookies-rich-butter-35g.jpg', 'Britannia Good Day Cookies - Rich Butter, 35g Pouch', 'Britannia Good Day Cookies are rich in butter which makes them crispier. These crispy crunchy cookies are perfect companions for tea. This flavourful cookie from Britannia is rich in calcium and is available with different add-ons like pistachio, almond, chocolate chips.', 'Britannia Good Day cookies contain Wheat Flour, Vegetable oil, Butter, Skimmed Milk Powder, Salt, Soya Lecithin and Annatto Extract.\r\nPer serving of this biscuit contains 140 Calories. It also contains a total fat content of 6g, saturated Fat of 3g, Cholesterol 4mg, Sodium of 90mg, Total Carbohydrates of 19g, sugar of 7g and Proteins of 2g.', '35', '25', 'GRAM', 'POUCH', 5, 0, 5),
