(55, 1, 2, 'Britannia Good Day - Chunkies, 100g_12_03_2017_britannia-good-day-chunkies-100g.jpg', 'Britannia Good Day - Chunkies, 100g Carton', 'Its a Smile that makes it a Good Day! The smaller joys of life that can brighten up ones life everyday often get ignored in the pursuit of larger joys. With its tagline of Har cookie mein kayi Smiles. Good Day will act as an enabler in enjoying all those small moments in everyday life!\r\nIn its brand new tastier avatar, Britannia Good Day brings alive its philosophy of Smiles through its new Logo, packaging and cookie, the New Good Day cookie comes with a smiley design on it as well!', 'Britannia Good Day - Chunkies', '100', '25', 'GRAM', 'CARTON', 50, 0, 50),
