(57, 29, 2, 'Sunfeast Delishus Gourmet Cookies - Nuts & Raisins, 60g_12_03_2017_sunfeast-delishus-gourmet-cookies-nuts-raisins-60g.jpg', 'Sunfeast Delishus Gourmet Cookies - Nuts & Raisins, 60g Carton', 'Sunfeast brings to you the unique gourmet cookie experience, laden with juicy raisins and rich nuts. These tasty Raisins and Nuts chip cookies are worth the calorie indulge.', 'Wheat Flour, Sugar, Bakery shortening, Cashew Bits 9.0%, Butter, invert syrup, Almond 2.8%, Milk solids, Liquid Glucose, Raising Agents, Baking Powder, Starch, Edible Common Salt and Emulsifier. Contains Permitted added flavour (s) (Artificial Flavouring Substances Vanilla, Cashewnut, Nauture Identical Flavouring Subtances. Milk & Nature Identical Flavouring SubstancesButter, Cardamom).', '60', '25', 'GRAM', 'CARTON', 30, 0, 30),
