(67, 38, 7, 'Bru Instant Super Strong Coffee, 500g Pouch_12_03_2017_bru-instant-super-strong-coffee-pouch-500g.jpg', 'Bru Instant Super Strong Coffee, 500g Pouch', 'Bru is a world renowned brand that makes its brew of coffee from beans picked from the finest plantations. It is known for its flavourful and aromatic beans that add a punch to that morning cup of coffee. Brus instant super strong coffee is made up of robust Arabica beans that bring in a rich taste in a cup that promises you an edge and lots of energy.', '\r\nThis coffee is Brus signature blend and it contains 30% chicory and 70% coffee for flavor and aroma. The beans are roasted to perfection before being packaged under a stringent quality control environment.', '500', '25', 'GRAM', 'POUCH', 350, 0, 350),
(68, 40, 8, 'Tropicana Apple 100 Juice, 200 ml Terapack_15_03_2017_tropicana-100-apple-juice-v-200-ml.png', 'Tropicana Apple 100% Juice, 200 ml Terapack', 'Tropicana 100% Apple fruit juice with no added sugar for a healthy you. With no added preservatives, color or artificial flavouring, Tropicana puts the good in morning. Add a glass of Tropicana 100% to your breakfast and give your day a great start. Its 9 nutrients revitalize your body and awaken your senses. Be alive, all day long.', '100 % Pure Apple Juice, Vitamin C (Ascorbic Acid).', '200', '25', 'ML', 'TERAPACK', 30, 0, 30),
