(73, 41, 9, 'Bisleri Mineral Water, 5 ltr Can_15_03_2017_bisleri_5l.png', 'Bisleri Mineral Water, 5 ltr Can', 'Bisleri is one of the most popular brands for bottled water. Bisleri follows a six-step stringent purification process which means that the water from Bisleri is pure and absolutely good for your health. Even the bottles where the water is stored are made in Bisleri plants as well to avoid contamination.', 'A bottle of Bisleri water contains calcium, chlorides, magnesium and TDS; all of which are absolutely essential for healthy well-being.\r\nThe best thing about consuming mineral water is that it has no calories and no fat. If you are trying to lose weight, then you should curb your daily intake of aerated drinks and increase the amount of mineral water which will keep the body hydrated and healthy. Known as a great source of sulphates, mineral water helps in the digestion process as well.\r\n\r\n\r\n', '5', '25', 'LTR', 'CAN', 65, 0, 65),
(74, 41, 9, 'Bisleri Mineral Water, 1 lt Bottle                    _15_03_2017_bisleri_1l.jpg', 'Bisleri Mineral Water, 1 lt Bottle', 'Bisleri Mineral Water has minerals and other dissolved substance is called mineral water. Minerals add therapeutic value to the water; the minerals generally added are magnesium sulphate, calcium, potassium bicarbonate and iron.\r\n\r\n ', 'Organized water, minerals (magnesium sulphate, potassium and carbonate).', '1', '25', 'LTR', 'BOTTLE', 20, 0, 20),
(75, 42, 9, 'Kinley Mineral Water, 1 lt Bottle_15_03_2017_kinley-mineral-water-1l.jpg', 'Kinley Mineral Water, 1 lt Bottle', 'Kinley Mineral Water is ozonised to remove fungi and bacteria and then filtered through sand filtration to remove every coarse impurities (up to 30 microns in size) after which the water is passed through carbon activated candles to neuter every odor or color present in the water.', 'Treated Water, Salts of Sodium and Magnesium.\r\n\r\n', '1', '25', 'LTR', 'BOTTLE', 20, 0, 20),
(76, 42, 11, 'Kinley Club Soda, 750 ml Bottle_15_03_2017_kinley-club-soda-750-ml-bottle.jpg', 'Kinley Club Soda, 750 ml Bottle', 'Since its launch in 2002, Kinley Club Soda neutral-flavoured soda which blends well with all kinds of drinks has been quite favourite among people who want to experiment with their drinks. This is one of the indispensable elements in any cocktails. In some cocktails, the soda is added as a top-off to provide the extra fizz.\r\n\r\n', '\r\nAlong with carbonated water, salts of sodium and magnesium are used to make this fizzy drink. The club soda has different minerals than still water; but drinking club soda can actually keep your body hydrated.\r\nApart from cocktails, soda can also be used with juices to make a nice flavourful mocktail.\r\n\r\n\r\n\r\n', '750', '25', 'ML', 'BOTTLE', 18, 0, 18),
(77, 43, 11, 'Coca Cola Soft Drink, 750 ml Bottle_15_03_2017_coca-cola-soft-drink-750ml.jpg', 'Coca Cola Soft Drink, 750 ml Bottle', 'Coca-Cola is the most popular and biggest-selling soft drink in history, as well as the best-known brand in the world.\r\n\r\n', '\r\nCarbonated Water, Acidity Regulator (338), Sweeteners (951,950), Preservative (211), Caffeine. Contains Permitted Natural Colour (150d) and Added Flavours (Natural Flavouring Substances). (Natural Flavoring Substances.) Contains no Fruit.\r\nCalories: 44kcal\r\nTotal Fat: 0g \r\nTotal Carb: 11g\r\nSugars: 11g \r\nProtein: 0g\r\n\r\n\r\n', '750', '25', 'ML', 'BOTTLE', 40, 0, 40),
(78, 44, 11, 'Thums Up Soft Drink, 750 ml Bottle_15_03_2017_thums-up-soft-drink-750ml.jpg', 'Thums Up Soft Drink, 750 ml Bottle', 'Thums Up is one of the most popular soft drink brands from the house of Coca Cola. This fizzy drink creates a refreshing effect on a warm summer day. This sugary drink gives an instant sugar rush in the body which people perceive as an instant energy rush. The tingly tangy taste of the bubbles makes the drink quite appealing, as it creates a popping sensation in the mouth.\r\n\r\n', '\r\nThums Up contains sugar, carbonated water, acidity regulator, sugar, added flavours and natural colour. It also contains caffeine in smaller portions.\r\nThums Up can be used to make Masala Cola, a popular fizzy drink with ground spices and jal jeera. This carbonated drink is a favourite accompaniment with quick bites such as fried chicken and pizzas.\r\n\r\n\r\n\r\n', '750', '25', 'ML', 'BOTTLE', 40, 0, 40),
(79, 45, 11, 'Sprite Soft Drink, 750 ml Bottle_15_03_2017_sprite-soft-drink-750ml.jpg', 'Sprite Soft Drink, 750 ml Bottle', 'Sprite soft drink is a lemon-lime flavored, colorless, caffeine-free soft drink, produced by the Coca-Cola Company. ', ' It gives the lemon flavor', '750', '25', 'ML', 'BOTTLE', 40, 0, 40),
(80, 46, 11, 'Fanta Soft Drink - Orange Flavor, 750 ml Bottle_15_03_2017_fanta_750ml.jpg', 'Fanta Soft Drink - Orange Flavor, 750 ml Bottle', 'This fruit flavoured drink from the house of Coca Cola is a long standing favourite for many soft drink enthusiasts. Fantas orange flavour was first manufactured during the World War II, over 75 years ago! This soft drink is also available in various other flavours, although the orange flavour remains a strong favourite for many people.\r\n\r\n', '\r\nThis soft drink basically has carbonated water which is the base for other ingredients like the extracts from vegetables like carrots and pumpkin, sugar, orange concentrate, potassium sorbate for the preservative, sweeteners, and even malic acids and acidity regulators.\r\n\r\n', '750', '25', 'ML', 'BOTTLE', 40, 0, 40),
(81, 39, 12, 'Tata Tea Gold Leaf, 500 gm_15_03_2017_tata-tea-gold-leaf-500gm.jpg', 'Tata Tea Gold Leaf, 500 gm', 'Tata Tea Gold is one of the most popular choices for tea-lovers. This tea dust contains an assortment of long leaves and tea powder which when boiled in water, promises to give off a rich aroma. The texture of the tea becomes better when it is infused with milk and sugar. Those who like their tea strong will definitely find this tea pleasing to the palate.\r\n\r\n', 'Even if you are not a regular drinker of tea, you will be pretty surprised to know about the many benefits of this beverage. Tata Tea Gold is rich in flavonoid which has strong antioxidant properties that can reduce cell damage. Tea is known to improve the functions of the blood vessels, and reduces the risks of stroke and heart disease.\r\n\r\n', '500', '25', 'GRAM', 'CARTON', 220, 0, 220),
(82, 47, 12, 'Red Label Tea, 500 gm Carton_15_03_2017_red-label-tea-500gm.jpg', 'Red Label Tea, 500 gm Carton', 'Brews togetherness by bringing people together over a tasty cup of tea made with your love and warmth.\r\n\r\n', '\r\nâ€¢Tea when drunk on its own, without milk and sugar, not only tastes great but contains virtually no calories. This means that tea is an excellent accompaniment to a healthy balanced diet and lifestyle. â€¢ Tea is hydrating and ranked as the second most ideal fluid choice for hydration after water. Hydration is essential in maintaining health and wellbeing. â€¢Tea is a rich source of flavonoids in the diet. It has been shown that in tea drinking populations, tea provides a significant contribution to daily flavonoid intake. A positive association has been linked between regular tea consumpt', '500', '25', 'GRAM', 'CARTON', 205, 0, 205),
(83, 47, 12, 'Red Label Tea - Natural Care, 500 gm_15_03_2017_red-label-tea-natural-care-500gm.jpg', 'Red Label Tea - Natural Care, 500 gm', 'â€¢ Red Label Natural Care is from the house of Brooke bond and the brand Red Label. Red Label Natural Care Tea contains the goodness of 5 Natural Ingredients - Cardamom, Ginger, Tulsi, Mulethi & Ashwagandha, all of them are extremely beneficial for your body as they enhance immunity while giving a unique flavor to the rich tea.\r\n', 'â€¢ Red Label Natural Care contains Cardamom which helps in digestion\r\nâ€¢ Red Label Natural Care contains Ginger which Helps protect from cough & cold\r\nâ€¢ Red Label Natural Care contains Tulsi which helps build body resistance and Mulethi which helps soothe the throat\r\nâ€¢ Red Label Natural Care contains Ashwagandha which helps cope with stress.\r\n', '500', '25', 'GRAM', 'CARTON', 237, 0, 237),
(84, 4, 13, 'Amul Butter - Pasteurized, 500 gm Carton_15_03_2017_amul-butter-pasteurized-500gm.jpg', 'Amul Butter - Pasteurized, 500 gm Carton', 'Amul is synonymous with Butter in India.\r\nSeveral Generation of Indian consumers have grown up with the taste of Amul Butter for the six decades.\r\nUtterly Butterly Delicious taste of Amul Butter is must on breakfast table of almost every Indian Household.\r\nUtterly Cute Amul Butter Girl has been a part of Indian Consumers since 1950.\r\nAmul Butter topical is recognized as one of the longest running advertisement campaign in the world.\r\n\r\n', 'Milk FAT, Min : 80%\r\nMoisture Mix : 16%\r\nSalt, Max : 3%\r\nCurd, Max : 1%\r\n\r\n', '500', '25', 'GRAM', 'CARTON', 215, 0, 215),
