(104, 15, 60, 'Dove Dandruff Care Shampoo, 180ml_16_03_2017_Dove_Dandruff_care_shampoo_180ml.png', 'Dove Dandruff Care Shampoo, 180ml', 'When those white flakes appear, all we want to know is how to prevent dandruff - and quickly. Our solution is Dove Dandruff Care Shampoo; the formula gets to work fast, starting to clear up flakes and fight the symptoms of dandruff from the first wash. Were so confident in our anti-dandruff shampoo because weve clinically tested the results.', 'Water, Sodium Laureth Sulfate, Cocamidopropyl Betaine, Dimethiconol and TEA-Dodecylbenzene Sulfonate, Zinc Pyrithione, Dimethicone and Laureth-4 and Laureth-23 and Poloxamer 407, Perfume, Carbomer, Glycerin, Sodium Chloride, Sodium Hydroxide, Guar Hydroxypropyltrimonium Chloride, Zinc Sulfate, Helianthus Annuus (Sunflower) Seed Oil, Lysine Hydrochloride, DMDM Hydantoin, Methylisothiazolinone.', '180', '25', 'ML', 'BOTTLE', 135, 10, 122),
(105, 15, 60, 'Dove Conditioner - Damage Solution Intense repair, 170ml_16_03_2017_Dove_Intensive_Repair_Conditioner_170ml.png', 'Dove Conditioner - Damage Solution Intense repair, 170ml', 'Dove Intense Repair Conditioner provides instant deep nourishment to your hair and helps prevent split ends and breakages. The innovative fiber actives penetrate deep inside your hair shaft to strengthen hair from within reducing damage and while the Micro Moisture Serum in this Intense Repair Conditioner locks in your hairs natural moisture which is generally lost to daily exposure to heat and sun. Get the Dove Intensive Repair Conditioner now and help reverse the damage your beautiful hair has gone through. Regular usage will give you noticeably healthier looking hair!', 'Cetearyl Alcohol, Behentrimonium Chloride, Keratin Actives', '170', '25', 'ML', 'BOTTLE', 186, 0, 186),
(106, 54, 59, 'Nivea Face Wash - Dark Spot Reduction (10X Whitening), 50ml_16_03_2017_2-Dark-Spot-Reduction-Face-Wash-50ml.png', 'Nivea Face Wash - Dark Spot Reduction (10X Whitening), 50ml', 'Effectively reduces dark spots and makes skin look healthier and feel fresher.â€¢ Nivea men Dark Spot Reduction Face Wash reduces the appearance of dark spots and makes skin look healthy and feel fresh. The effective 10x formula, suitable for All Skin Types, is now even better with Whitanat Vita Complex Plus that contains 10 nutrients.', 'Licoriceâ€¢ Vitamin Câ€¢ Whitanatâ€¢ Vitamin Eâ€¢ Pro Vitamin B5â€¢ Ginko Leaves Extractâ€¢ Ginseng Root Extractâ€¢ Glycerinâ€¢ Magnesium Chlorideâ€¢ Glyceryl Glucoside', '50', '25', 'ML', 'TUBE', 95, 0, 95),
