(127, 61, 66, 'Dabur Chyawanprash Sugarfree, 500gm Jar_19_03_2017_sugarfreechavanprakash-500gm.png', 'Dabur Chyawanprash Sugarfree, 500gm Jar', 'Dabur has been at the forefront of making the age-old wisdom of Ayurveda relevant for todays living through formulations that add health to our lives. Through this expertise, Dabur brings to you Dabur ChyawanPrakash that gives you Immunity in a sugar-free format. It contains no added sugar, and is suitable for Diabetics.', 'Amla (Indian Goosberry) , Yashtimadhu (Glycyrrhiza glabra) , Brahmi (Bacopa monnieri) , Bilya (Agele marmelos) , Gokshura (Tribulus terrestris) , Pippali (Pipal longum) , Guduchi (Tinospora cordifolia) , Haritaki (Terminalia chebula) , Bala (Sida cordifolia) , Vasa (Adhatoda vascia) , Punarnaya (Boerhaavia diffusa) , Riddhi (Off sbust.- Varahi) (Dioscorea bulbifera) , Vriddhi (Off sbust.- Varahi) (Dioscorea bulbifera) , Meda (Off subst.- Shatawari) (Asparagus racemosus) , Mahamedha (Off subst.- Shatawari) (Asparagus recemosus) , Kakoli (Off subst.- Ashwagandha) (Withania somnifera) , Amalaki (', '500', '25', 'GRAM', 'JAR', 170, 0, 170),
(128, 61, 66, 'Dabur Chyawanprash Awaleha, 250gm Jar_19_03_2017_Dabur-Chyawanprash-250gm.png', 'Dabur Chyawanprash Awaleha, 250gm Jar', 'Dabur Chyawanprash is a time-tested Ayurvedic formulation of more than 41 Ayurvedic herbs that aid in boosting the immune system, thereby protecting the body from everyday infections like cough & cold etc. caused by bacteria, viruses, dust and weather change.\r\nIn Sanskrit, the word prash stands for a specially prepared food and Chyawan was the name of the sage for whom this Ayurvedic nutritive formula was concocted to restore his youth & vitality. Thus the name Chyawanprash. As a health supplement, Dabur Chyawanprash can be taken by people from all age groups- kids, adults and elderly people a', 'Amla (Indian Goosberry) , Yashtimadhu (Glycyrrhiza glabra) , Brahmi (Bacopa monnieri) , Bilya (Agele marmelos) , Gokshura (Tribulus terrestris) , Pippali (Pipal longum) , Guduchi (Tinospora cordifolia) , Haritaki (Terminalia chebula) , Bala (Sida cordifolia) , Vasa (Adhatoda vascia) , Punarnaya (Boerhaavia diffusa) , Riddhi (Off sbust.- Varahi) (Dioscorea bulbifera) , Vriddhi (Off sbust.- Varahi) (Dioscorea bulbifera) , Meda (Off subst.- Shatawari) (Asparagus racemosus) , Mahamedha (Off subst.- Shatawari) (Asparagus recemosus) , Kakoli (Off subst.- Ashwagandha) (Withania somnifera) , Amalaki (', '250', '25', 'GRAM', 'JAR', 84, 0, 84),
