(130, 62, 67, 'Iodex Pain Balm - Multi-Purpose, 16gm_19_03_2017_iodex-multi-purpose-pain-balm-16-gm.jpg', 'Iodex Pain Balm - Multi-Purpose, 16gm', 'Fast relief multi purpose pain balm. Iodex Balm is a power packed formula of 5 natural ingredients. Help provide a warm & soothing effect at the site of pain that helps reduce inflammation & relieves pain. Helps provide effective relief from different types of musculo-skeletal pains like neck/shoulder pain, back pain, joint pain, sprain, etc. A trusted pain relief brand in India for close to 100 years.\r\n\r\nHead Fast, Double Power.\r\n\r\nPain Balm Ayurvedic Proprietary Medicine.', 'Iodex Pain Balm - Multi-Purpose', '16', '25', 'GRAM', 'CARTON', 60, 0, 60),
