(134, 26, 58, 'Ponds Talc - Dreamflower Fragrant, 50gm Bottle_27_03_2017_ponds-talc-dreamflower-fragrant-50g.jpg', 'Ponds Talc - Dreamflower Fragrant, 50gm Bottle', 'Ponds Dreamflower Fragrant Talcum Powder envelopes you with alluring aroma and sparkle. This gentle powder softly caresses your skin while providing long lasting protection against body odor and perspiration. Remain clean and fresh all day long with this satin textured powder. Loaded with natural ingredients, the powder is gentle and effective and also provides instant fairness to your skin. Even out your skin tone and make it look non-patchy or oily with this powder. It is also easy to apply. Buy the Ponds Dreamflower Fragrant Talcum Powder now, so you can present yourself confidently even on', 'Hydrated Magnesium Silicate, Calcium Carbonate, Fragrance', '50', '25', 'GRAM', 'BOTTLE', 35, 0, 35),
(135, 2, 25, 'Aashirvaad Atta - Multigrains, 5 kg_20_03_2017_aashirvaad-atta-multigrains.jpg', 'Aashirvaad Atta - Multigrains, 5 kg', 'The Aashirvaad multigrain atta is an amazing combination of six natural grains which provide wholesome nutrition to the body. The rotis and chapattis made from multigrain atta are not only tasty, but extremely nutritious as well.', 'The best thing about multigrain Aashirvaad atta is that whole grains like soya, wheat, chana, oats, and maize and psyllium husk are added to the atta to provide wholesome goodness to the eaters.', '5', '25', 'KG', 'POUCH', 265, 5, 252),
(136, 2, 25, 'Aashirvaad Atta - Select, 5kg_21_03_2017_aashirvaad-atta-select.jpg', 'Aashirvaad Atta - Select, 5kg', 'Premium quality atta, made from 100% MP Sharbati wheat. â€¢ Aashirvaad Select atta is made from 100% MP Sharbati wheat that is harvested exclusively in 7 districts of Madhya Pradesh. Here, the golden fields are sun-kissed to perfection and showered by the right amount of rain. This is why each grain has a golden sheen and is heavier in feel. Aashirvaad Select is prepared to give you the finest, softest and fluffiest rotis you have ever tasted. The best of nature, with every bite!', '100% MP Sharbati Wheat', '5', '25', 'KG', 'POUCH', 255, 8, 235);
