(150, 69, 26, 'Tata Sampann Toor Dal, 1 kg_20_03_2017_tata-sampann-toor-dal.jpg', 'Tata Sampann Toor Dal, 1 kg', 'Dals or lentils are a staple in Indian cooking. Every Indian home will see at least one dal dish on the table during lunch and dinner. The unpolished Toor Dal from the house of Tata is a high quality product that is nutrient heavy and used in a variety of preparations in most parts of India.', 'Tata I Shakti Unpolished Toor Dal comes in various quantities. This 1 kg pouch contains Toor dal that has been sources from the best farm lands in the country. It is unpolished and retains its soft outer covering which acts as precious fibre for the system, even as this dal provides essential protein, magnesium, potassium and other minerals to the body.\r\n\r\n', '1', '25', 'KG', 'POUCH', 126, 0, 126),
(151, 69, 26, 'Tata Sampann Channa Dal, 1 kg_20_03_2017_tata-sampann-channa-dal.jpg', 'Tata Sampann Channa Dal, 1 kg', 'Indulge in the true flavours of nature with the all-natural Tata I Shakti dal. The range of Tata pulses come with a promise of superior quality and genuine flavours. Tata I Shakti pulses are cultivated in Indian farms and are grown in completely natural conditions to bring to you the purest form of health and nutrition. The Tata channa dal is free from any added chemicals, colour or any other foreign element. The unpolished I Shakti dal is not exposed to the harmful marble powder, oil polish or animal skin touch that are the base polishing elements found in polished pulses. Tata Shakti dal is ', 'Nutritional Information Per 100gms (approximate values: Energy 386Kcal, Calories from fat 50Kcal, Protein 20.09g, Fat 5.60g, Carbohydrates 63.94g, Dietary Fibre 15.83g, Cholesterol <1mg, Fatty Acids: Saturated fat 0.73g, Mono unsaturated fat 1.31g, Poly unsaturated fat 3.56g, Minerals: Sodium as Na 56mg, Calcium as Ca 0.05g, Iron as Fe 4.73mg.', '1', '25', 'KG', 'POUCH', 166, 0, 166),
