(153, 70, 30, 'India Gate Basmati Rice - Feast Rozzana, 5 kg _20_03_2017_india-gate-basmati-rice-feast-rozzana.jpg', 'India Gate Basmati Rice - Feast Rozzana, 5 kg ', 'India Gate Basmati Rice Feast Rozzana is defined by its long grains and amazing aromatic flavour. Having this rice is truly having a feast rozzana (a daily feast); combine it with your veggies and serve a nice pulao. Without this Basmati Rice, your biryanis will seem dull and tasteless. This is the perfect ingredient for different rice recipes.', 'The long-grained cultured basmati which has been matured for one year comes to your home in the form of India Gate Basmati Rice Feast Rozzana. Grown in the most fertile region of the Indo-Gangetic Plains beneath the Himalayan sub-range, Basmati receives its nutty taste and characteristic aroma because of the fertile alluvial soil and the cold and fresh air of the region. Like wine, it gets better with age; maturing it for one to two years intensifies its taste and aroma.', '5', '25', 'KG', 'POUCH', 395, 5, 375),
(154, 70, 30, 'India Gate Basmati Rice - Mogra, 5 kg_20_03_2017_india-gate-basmati-rice-mogra.jpg', 'India Gate Basmati Rice - Mogra, 5 kg', 'It is hard to miss the amazing aroma of India Gate Basmati Rice Mogra from a distance; the fine long grains and the aromatic flavour simply stir up your appetite. The India Gate basmati Mogra can be uniquely identified by the length of the grain and the fragrance which makes your pulao, biriyani and risotto all the more appealing.', 'Mogra originates from the Terai region, close to North-western Himalayas which is known as the heartland of basmati. The quality of the harvest is undoubtedly the best; it is tested, procured and then matured for one year. As a result the grains are longer; they do not break or stick together and has an unmistakably amazing aroma.', '5', '25', 'KG', 'BAG', 320, 0, 320),
