(184, 82, 23, 'Galaxy Chocolate - Smooth Milk, 40gm Pouch_20_03_2017_galaxy-chocolate-smooth-milk-40g.jpg', 'Galaxy Chocolate - Smooth Milk, 40gm Pouch', 'Galaxy chocolate smooth milk is an irresistible chocolatey delight which is loaded with health benefits too. It has the goodness of milk and richness of chocolate that make it a beneficial food item suitable for consumption, whenever you are struck by chocolate cravings. This chocolate is prepared in the most hygienic manner, is of premium quality and is packaged safely to avoid contamination or damage. Galaxy is a famous name in the world of chocolates and continuously strives to bring the best to its admirers.', 'It contains sugar, cocoa butter, cocoa mass, skimmed milk powder, milk fat, lactose, whey powder, vegetable fat, emulsifier (soya lecithin), natural vanilla extract, minimum 14% milk solids, 25% cocoa solids and vegetable fats.', '40', '25', 'GRAM', 'POUCH', 40, 0, 40),
