(242, 45, 11, 'Sprite Soft Drink, 300 ml _23_03_2017_sprite-soft-drink-300ml.jpg', 'Sprite Soft Drink, 300 ml ', 'Sprite is a lime- lemon flavored soft drink. This carbonated soft drink includes no caffeine. The high acidic content of Sprite Soft Drink also assists cure digestion problems.\r\n\r\n', '\r\nCarbonated Water, Sugar, Acidity Regulators (330, 331), Preservative (211). Contains Added Flavours (Natural Flavouring Substances). Contains no Fruit.\r\n\r\n', '300', '25', 'ML', 'CAN', 35, 0, 35),
