(261, 13, 36, 'Comfort Fabric Conditioner - After Wash Lily Fresh, 1.5 ltr_24_03_2017_comfort-fabric-conditioner-after-wash-lily-fresh-1.5l.jpg', 'Comfort Fabric Conditioner - After Wash Lily Fresh, 1.5 ltr', 'New Comfort After Wash Fabric Conditioner 99% Anti Bacterial Action (Green) 200 ml Bottle gives your clothes unbeatable shine & fragrance that detergents alone cant deliver. Comfort is a liquid fabric conditioner which is easy to use with bucket wash as well as machine wash. Even if you wash your clothes with the best detergent, the fibers in your clothes get tangled. So your clothes look dull & lifeless in just a few washes. Comfort untangles the cloth fibers & protects them from the damage caused by detergents. Comfort Fabric conditioner gives your clothes unbeatable softness, new-like shine', 'New Comfort Fabric Conditioner (Green) now with fragrance pearls. Gives All-day freshness to your clothes and has 99% Anti-bacterial Action.\r\nâ€¢ New Comfort After Wash Fabric Softener 99% Anti-bacterial Action (Green) 200ml Bottle makes clothes soft, smooth & great to wear\r\nâ€¢ Use New Comfort Fabric Conditioner to get Unbeatable shine & fragrance that detergents alone cant deliver\r\nâ€¢ Your New Comfort Fabric Conditioner goes deep into the fibres of the cloth & smoothens them, protecting from the damage caused by detergent, and gives them a new-like shine\r\nâ€¢ New Comfort is a liquid Fabric ', '1.5', '25', 'LTR', 'CAN', 358, 0, 358),
