(270, 21, 63, 'Lux Soft Touch Silk Essence & Rose Water Soap Bar, 150 gm Carton_25_03_2017_lux-soft-touch-silk-essence-rose-water-soap-bar-150g.jpg', 'Lux Soft Touch Silk Essence & Rose Water Soap Bar, 150 gm Carton', 'Get soft, fresh and revitalized skin with the Strawberry & Cream soap bar from Lux. Formulated with rich strawberry cream and silk protein extracts, this alluring soap bar offers complete hydration to your skin. The soap bar works to retain your skins natural body oils and nourishes it with the creamy, rich lather. The fruity strawberry scent envelops your body and gives it a refreshed feel. For soft, supple and sweet smelling skin, pick the Lux Strawberry & Cream soap bar, now!\r\n\r\n', '\r\nRose Water, Silk Essence, Sodium Palmate, Sodium Palm Kernelate, Water, Glycerin, Perfume, Sodium Chloride, Mica, Titanium Dioxide, Tin Dioxide, Tetrasodium Etidronate, Honey, Milk Lipids, Citrus Aurantium Dulcis Peel Extract, Cyperus Rotundus Extract, Phyllanthus Emblica Extract, Curcuma Zedoaria Extract, Trideceth-9, Artemisia Pallens Extract, Curcuma Aromatica Extract, Vetiveria Zizanoides Extract, Santalum Album Oil, Propylene Glycol, Hydrogenated Castor Oil, Tetrasodium Edta, Methylchloroisothiazolinone, Methylisothiazolinone, Alpha-Isomethyl Ionone, Benzyl Alcohol, Citronellol, Coumari', '150', '25', 'GRAM', 'CARTON', 38, 0, 38),
(273, 25, 61, 'Pepsodent Toothpaste - Whitening Germicheck, 80 gm_25_03_2017_pepsodent-toothpaste-whitening-germicheck-80g.jpg', 'Pepsodent Toothpaste - Whitening Germicheck, 80 gm', 'Pepsodent Whitening Toothpaste contain a proven cavity fighting formula that helps eliminate plaque and is especially formulated to assist get your teeth their whitest. Best of all, it supplies complete guard for strong enamel and healthy gums.\r\n\r\n', ' Calcium Carbonate, Water, Sorbitol, Hydrated Silica, Sodium Lauryl Sulfate, Sodium Monoflourophosphate, Flavor, Perlite, Cellulose Gum, Potassium Citrate, Sodium Silicate, Sodium Sacharin, DMDM Hydantoin, CI 74160, and CI 77891.\r\n\r\n', '80', '25', 'GRAM', 'PACK', 47, 0, 47),
(274, 25, 61, 'Pepsodent Toothpaste - Germicheck, 150 gm ( Pack of 2 )_25_03_2017_pepsodent-toothpaste-germicheck-150 x 2gpack.jpg', 'Pepsodent Toothpaste - Germicheck, 150 gm ( Pack of 2 )', 'Restore your bright smile with the Pepsodent Germicheck toothpaste. Keep your teeth white and shining all day long while it also helps fight unwanted dental problems like tartar build up and plaque formation with the help if a specially designed formula. Enriched with fluoride and Germicheck formula, the tooth paste keeps your teeth and gums healthy. The toothpaste also retains the natural enamel of the teeth and strengthens the gums. Available in a 150 g tube, buy this right away and use Pepsodent Germicheck regularly for strong and shinier teeth.\r\n\r\n', 'Fluoride, Triclosan\r\n\r\n', '150', '25', 'GRAM', 'PACK', 127, 0, 127),
(275, 29, 2, 'Sunfeast Marie Light Biscuit - Orange, 120 gm Pouch_25_03_2017_sunfeast-marie-light-biscuit-orange-120g.jpg', 'Sunfeast Marie Light Biscuit - Orange, 120 gm Pouch', 'Sunfeast Marie Light orange offer crisp & light biscuits completed with the choicest golden grains of sun-ripened oranges and wheat. It presents the only Marie biscuit in India with a stimulating, delicious orange flavour. WhatÃƒÂ¢Ã¢â€šÂ¬Ã¢â€žÂ¢s more, there is 0% transfat and 0% cholesterol making it an appetizingly vigorous biscuit.\r\n\r\nIt keeps you and your family on the track to good health. Make sure your drawer or shelves are always filled with Sunfeast Marie Light Orange biscuits', 'Wheat Flour (66%), Sugar, Edible Vegetable Oil, Raising Agents, Baking Powder, Milk, Soilds, Invert Syrup, Edible Common Salt, Emulsifier (Ins 471), Wheat Flake (0.15%), Dough Conditioner (Ins 223).\r\n\r\n', '120', '25', 'GRAM', 'POUCH', 15, 0, 15),
(276, 29, 2, 'Sunfeast Dark Fantasy Choco Creme, 100 gm pouch_25_03_2017_sunfeast-dark-fantasy-choco-creme-100g.jpg', 'Sunfeast Dark Fantasy Choco Creme, 100 gm pouch', 'Alluring, dark and tempting-Dark Fantasy Chocolate is one of our finest offerings. We propose you try one to understanding the savoury crust crumble, unfurling the enjoyment of heavenly chocolate cream within. Take that mouth-watering bite. Treat yourself to the best flavour of Dark Fantasy Chocolate let your lips get smacked all the time.\r\n\r\n', 'Choco cream (38%) (sugar, edible vegetable oil, cocoa solids, hydrogenated vegetable oils, emulsifier(ins 322), added artificial flavour (chocolate)), wheat flour, hydrogenated vegetable oils, sugar, liquid glucose, invert syrup, raising agents (ins 503(ii), baking powder), cocoa solids, bu1ter, milk solids, edible common salt and emulsifiers (ins 322, ins 471).\r\n\r\n', '100', '25', 'GRAM', 'POUCH', 25, 0, 25),
(277, 37, 23, 'Cadbury 5 Star Crunchy Chocolate Bar, 35 gm_27_03_2017_cadbury-5-star-crunchy-chocolate-bar-35g.jpg', 'Cadbury 5 Star Crunchy Chocolate Bar, 35 gm', 'A delicious indulgent combination of chocolate, caramel and nougat. Longer-lasting chewy multi textured chocolate eat experience.\r\n\r\n', '\r\nCentre (Nougatine + Caramel) 68% - Liquid Glucose, Sugar, Invert Sugar, Hydrogenated Vegetable Fat, Cocoa Solids, Milk Solids, Hydrolyzed Vegetable Protein, Edible Salt, Emulsifier (471); Milk Chocolate 32%- Sugar, Cocoa Butter, Milk Solids, Cocoa Solids, Emulsifiers (442, 476). Allergen Information- Contains Milk, Soy Manufactured On Equipment That Also Processes Products Containing Wheat, Peanuts And Tree Nuts\r\n\r\n', '35', '25', 'GRAM', 'POUCH', 25, 0, 25),
(278, 18, 69, 'Kitchens Of India Chutneys - Tomato & Chilli, 300 gm Bottle_27_03_2017_kitchens-of-india-chutney-tomato-chilli-300g.jpg', 'Kitchens Of India Chutneys - Tomato & Chilli, 300 gm Bottle', 'Kitchens Of India Chutneys - Tomato & Chilli', 'Kitchens Of India Chutneys - Tomato & Chilli', '300', '25', 'GRAM', 'JAR', 140, 0, 140),
(279, 18, 69, 'Kitchens Of India Conserve - Mango & Saffron Fruit and Spice, 320 gm Jar_27_03_2017_kitchens-of-india-conserve-mango-saffron-fruit-and-spice-320g.jpg', 'Kitchens Of India Conserve - Mango & Saffron Fruit and Spice, 320 gm Jar', 'Kitchens Of India Conserve - Mango & Saffron Fruit and Spice\r\n', 'Kitchens Of India Conserve - Mango & Saffron Fruit and Spice\r\n', '300', '25', 'GRAM', 'JAR', 140, 0, 140),
(280, 26, 57, 'Ponds Facial Foam - Age Miracle Cell ReGEN, 100 gm_27_03_2017_ponds-facial-foam-age-miracle-cell-regen-100g.jpg', 'Ponds Facial Foam - Age Miracle Cell ReGEN, 100 gm', 'Heres an anti-aging skincare product that will complement your beauty regime! Formulated with Intelligent Pro-Cell Complex and CLA, Ponds Age Miracle Facial Foam is an exfoliating foam cleanser with gentle micro granules that remove dead skin cells to reduce dullness, and enhance your skins overall radiance! Feel youthful and fresh, look younger- buy the Ponds Age Miracle Facial Foam in a compact tube of 100 gm, right here!\r\n\r\n', '\r\nIntelligent Pro Cell Complex With 6 Bio Actives That Give Skin 3X More Renewal Power, Retinol Helps In Skin Repair, Cla Promotes Cell Renewal And Aha Gently Helps In Skin Exfoliation\r\n\r\n', '100', '25', 'GRAM', 'TUBE', 299, 0, 299),
(281, 26, 58, 'Ponds Talc - Magic Freshness, 400 gm_27_03_2017_ponds-talc-magic-freshness-400g.jpg', 'Ponds Talc - Magic Freshness, 400 gm', 'Heres the secret to remain fresh and fragrant all summer- Ponds Dreamflower Magic Talcum Powder. This powder is formulated to help you stay fresh and pleasant smelling all day. Mesmerize everyone with your sweet fragrance of acacia honey and this talc not only protects you against perspiration but also provides you instant fairness. With its natural ingredients, the powder is safe and gentle on all skin types. The powder is smooth to apply on the body. Come summer, you can forget the stress of mid-day sweats with Ponds Dreamflower Magic Talcum Powder. ', 'Hydrated Magnesium Silicate, Calcium Carbonate, Fragrance\r\n\r\n', '400', '25', 'GRAM', 'BOTTLE', 201, 0, 201),
(282, 26, 57, 'Ponds Cold Cream - Silk, 30 ml_27_03_2017_ponds-cold-cream-silk-30ml.jpg', 'Ponds Cold Cream - Silk, 30 ml', 'Get supple and soft skin with Ponds Silk Cream. This formulation is infused with glycerin and niacinamide to provide deep nourishment to your skin. The cream penetrates deep into the cells and makes your skin look and feel smooth. It comes with 24-hour moisture lock to ensure that your skin remains properly hydrated and nourished all the time. Ponds Silk Cream is lightweight and does not leave skin sticky. It is readily absorbed into the skin, leaving it fresh. The cream is highly effective yet very gentle, making it suitable for all the skin types.', 'Glycerin, Niacin Amide, Isopropyl Myristate\r\n\r\n', '30', '25', 'ML', 'BOTTLE', 55, 0, 55),
(283, 28, 28, 'Sundrop SuperLite Advanced - Sunflower Oil, 5 ltr Can_27_03_2017_sundrop-superlite-advance-lite-5ltr.jpg', 'Sundrop SuperLite Advanced - Sunflower Oil, 5 ltr Can', 'Sundrop Super Lite Advanced with added DMPS (Dimethyl Polysiloxane) ensures that the absorption of oil is less while cooking, as compared to any ordinary oil. Its advanced refining process makes it extra light. It also fortified with sufficient quantity of Vitamin A and D which takes care of 25% of daily requirement of these essential vitamins. It is rich in natural vitamin E & Omega-6, an essential fatty acid vital for the proper functioning of the body.\r\n\r\n', '\r\n(Per 100 g) Energy (Kcal) 900 Protein (g): 0 Carbohydrate (g): 0 Total Fat (g): 9 Saturated Fatty Acids : 25 Mono Unsaturated Fatty Acids (g)66 Polyunsaturated Fatty acids(g) 0 Trans Fatty Acids (g) 100 Cholesterol (mg) 0\r\n\r\n', '5', '25', 'LTR', 'CAN', 980, 0, 980),
(284, 28, 28, 'Sundrop Oil - GoldLite, 5 ltr Can_27_03_2017_sundrop_gold_lite_musterd_oil-5ltr.png', 'Sundrop Oil - GoldLite, 5 ltr Can', 'Sundrop Gold Lite is rich in Essential Fatty Acid which cannot be synthesized by our body and provides recommended daily requirements of total EFA. Sundrop Gold Lite also has antioxidants which are known to boost our immune system to help fight diseases. It is very low in saturated fat content sticks less to foods. With Sundrop Gold lite we end up consuming less of the oil.\r\n\r\n', '\r\n(Per 20 g) Energy (Kcal): 180 Protein (g): 0 Carbohydrates (g): 0 Total Fatty acids (g): 20 Saturated fatty Acids: 2 Mono Unsaturated Fatty Acids (g): 5 Polyunsaturated fatty acids (g): 13 Trans fatty Acids (mg): 0 Total Essential Fatty Acids (g): 10 Cholesterol (mg): 0 Vitamin E (mg): 7/7\r\n\r\n', '5', '25', 'LTR', 'CAN', 685, 0, 685),
(285, 34, 57, 'Vaseline Intensive Care Aloe Soothe Body Lotion, 300 ml_27_03_2017_vaseline-intensive-care-aloe-soothe-body-lotion-300ml.jpg', 'Vaseline Intensive Care Aloe Soothe Body Lotion, 300 ml', 'Our fresh feel formula combines pure aloe extract and Stratys 3 multi-layer moisture to leave your skin deeply moisturized and feeling healthy, fresh, and soft. Moisturizes top three layers of surface skin (stratum corneum). Contains pure aloe extract, known to refresh and help soothe skin. ', 'Water, Glycerin, Stearic Acid, Glycol Stearate & Stearamide Amp, Isopropyl Palmitate, Soft Paraffin, Triethanolamine, Glyceryl Stearate, Dihydroxypropyl Triammonium Chloride, Hydroxyethyl Urea, Aloe Barbadensis Gel, Cetyl Alcohol, Dimethicone, Titanium Dioxide, Carbopol, Tapioca Starch, Dmdm Hydantoin, Dmdm Hydantoin & Iodopropynyl Butylcarbamate, Disodium Edta, Perfume.\r\n\r\n', '300', '24', 'ML', 'BOTTLE', 265, 15, 225),
(286, 34, 57, 'Vaseline Body Lotion - Healthy White Complete 10, 100 ml_27_03_2017_vaseline-body-lotion-healthy-white-complete-100ml.jpg', 'Vaseline Body Lotion - Healthy White Complete 10, 100 ml', 'Fed up of dry skin that makes you look dull? The Vaseline Healthy White Complete 10 offers a healthy respite. With vital components like Vitamin B3, AHA and sun screen, Vaseline offers the best protection for your face and skin, in this lotion. It is endowed with numerous benefits that ensure younger, brighter looking skin. The Vaseline Healthy White Complete 10 lotion ensures that your skin gets a better tone and feel with every application. Can be applied once a day or several times depending on the weather or your individual needs, but Its sure to bring out your youthfulness! This one is a ', '\r\nVitamin B3, Aha, Sunscreens\r\n\r\n', '100', '25', 'ML', 'BOTTLE', 130, 0, 130),
(288, 33, 60, 'TRESemme Shampoo - Keratin Smooth, 580 ml_29_03_2017_TRESemme Shampoo - Keratin Smooth-580 ml.jpg', 'TRESemme Shampoo - Keratin Smooth, 580 ml', 'Are you tired of maintaining your dry hair and frizz. Now control it all with the Tresemme Keratin Smooth Shampoo. A specially formulated smoothing shampoo for hair thats difficult to manage, this shampoo improves and provides prolonged smoothening results. It also eliminates frizz and strengthens hair follicles. You can now revive the lost moisture in your hair by using this shampoo, which is a balanced blend of Behentrimonium Chloride and Keratin. It is safe for use on natural, chemically-treated or color-treated hair. This lightweight shampoo also provides volume and bounce to your locks. B', '\r\nSodium Laureth Sulphate, Silicone, Keratin\r\n\r\n', '580', '25', 'ML', 'BOTTLE', 431, 15, 366),
(289, 35, 51, 'Sunfeast Yippee Noodles - Magic Masala, 70 gm Pouch_29_03_2017_sunfeast-yippee-noodles-magic-masala-70g.jpg', 'Sunfeast Yippee Noodles - Magic Masala, 70 gm Pouch', 'Sunfeast Yippee Noodles with Magic Masala is quick snack which can be prepared as an afternoon delight for your children. The instant noodles that have been quite popular among children because of the quick turnaround time are now available with masala or spices which add to the taste of the food. This is a 100% vegetarian food item which is normally cooked within 5 minutes.\r\n\r\n', '\r\nThe carrots, cabbage and ring beans used in Yippee noodles are real vegetables which are absolutely dehydrated before they are mixed to the masala mix. There are no synthetic colourings or preservatives. The dehydration process helps to increase the shelf life of the product.\r\n\r\n', '70', '25', 'GRAM', 'POUCH', 10, 0, 10),
(290, 35, 51, 'Sunfeast Yippee Noodles - Classic Masala, 70 gm Pouch_29_03_2017_sunfeast-yippee-noodles-classic-masala-70g.jpg', 'Sunfeast Yippee Noodles - Classic Masala, 70 gm Pouch', 'â€¢ ITC entered the instant noodles segment with the launch of Sunfeast Yippee! in 2010. The sourcing and blending expertise that has made Aashirvaad Indias No 1 branded Atta has been leveraged to create a delightful noodle block. The block being round in shape does not need to be broken while cooking, providing really long & slurpy noodles. A special scientific process ensures that the noodles does not lump even 30 minutes after cooking. â€¢ Yippee! instant noodles is available in three lip smacking variants - Classic Masala, Magic Masala and Chinese Masala. Classic Masala is the Classical In', '(Per 85 g) Calories 391 Sodium 0 mg Total Fat 16 g Potassium 0 mg Saturated 0 g Total Carbs 54 g Polyunsaturated 0 g Dietary Fiber 0 g Monounsaturated 0 g Sugars 4 g Trans 0 g Protein 9 g Cholesterol 0 mg\r\n\r\n', '70', '25', 'GRAM', 'POUCH', 12, 0, 12),
(291, 35, 51, 'Sunfeast Yippee Noodles - Classic Masala, 280 gm Pouch_29_03_2017_sunfeast-yippee-noodles-classic-masala-280g.jpg', 'Sunfeast Yippee Noodles - Classic Masala, 280 gm Pouch', 'ITC entered the instant noodles segment with the launch of Sunfeast Yippee! in 2010. The sourcing and blending expertise that has made Aashirvaad Indias No 1 branded Atta has been leveraged to create a delightful noodle block. The block being round in shape does not need to be broken while cooking, providing really long & slurpy noodles. A special scientific process ensures that the noodles does not lump even 30 minutes after cooking. ', '(Per 85 g) Calories 391 Sodium 0 mg Total Fat 16 g Potassium 0 mg Saturated 0 g Total Carbs 54 g Polyunsaturated 0 g Dietary Fiber 0 g Monounsaturated 0 g Sugars 4 g Trans 0 g Protein 9 g Cholesterol 0 mg\r\n\r\n', '280', '25', 'GRAM', 'POUCH', 45, 0, 45),
(292, 35, 51, 'Sunfeast Yippee Atta Noodles - Power Up Masala, 70 gm_29_03_2017_sunfeast-yippee-atta-noodles-power-up-masala1-70g.jpg', 'Sunfeast Yippee Atta Noodles - Power Up Masala, 70 gm', 'Vegetable Additions in every Noodle Strand.\r\n\r\n', 'Sunfeast Yippee Atta Noodles - Power Up Masala, \r\n', '70', '25', 'GRAM', 'POUCH', 15, 0, 15),
(293, 12, 36, 'Cif Kitchen Cleaner Power & Shine - 700 ml_03_04_2017_Cif_Kitchen_Cleaner_Power & Shine _700 ml.jpg', 'Cif Kitchen Cleane Power & Shine - 700 ml', 'Presenting new Cif Power & Shine Kitchen Cleaner â€“ a specialist kitchen cleaning spray which is a ONE-STOP SOLUTION for all your kitchen cleaning needs and suitable for all kitchen designs. We know youâ€™d do anything to MAKE THE HOME YOU LOVE BEAUTIFULLY CLEAN FOR YOUR FAMILY. Cif Power & Shine will deliver the promise of a brilliantly clean & beautifully shiny kitchen with every spray!', 'Cif Kitchen Cleaner Power & Shine - 700 ml', '700', '22', 'ML', 'BOTTLE', 249, 16, 209),
(294, 12, 36, 'Cif Multipurpose Cleaner Actifizz Lemon 700ml_03_04_2017_Cif_Multipurpose _Cleaner _ Actifizz _Lemon 700ml.jpg', 'Cif Multipurpose Cleaner Actifizz Lemon 700ml', 'Presenting new Cif Actifizz Multipurpose Cleaner â€“ a specialist cleaning spray which is a ONE-STOP SOLUTION for all your home/ living room cleaning needs and suitable for all living room designs. We know youâ€™d do anything to MAKE THE HOME YOU LOVE BEAUTIFULLY CLEAN FOR YOUR FAMILY. Cif Actifizz will deliver the promise of a brilliantly clean & beautifully shiny home with every spray', 'Cif Multipurpose Cleaner, Actifizz Lemon 700ml', '700', '25', 'ML', 'BOTTLE', 249, 5, 237),
(295, 12, 36, 'Cif Multipurpose Cleaner Actifizz Ocean 700ml_03_04_2017_Cif Multipurpose Cleaner, Actifizz Ocean 700ml.jpg', 'Cif Multipurpose Cleaner Actifizz Ocean 700ml', 'Presenting new Cif Actifizz Multipurpose Cleaner â€“ a specialist cleaning spray which is a ONE-STOP SOLUTION for all your home/ living room cleaning needs and suitable for all living room designs. We know youâ€™d do anything to MAKE THE HOME YOU LOVE BEAUTIFULLY CLEAN FOR YOUR FAMILY. Cif Actifizz will deliver the promise of a brilliantly clean & beautifully shiny home with every spray!', 'Cif Multipurpose Cleaner, Actifizz Ocean 700ml\r\n', '700', '25', 'ML', 'BOTTLE', 249, 9, 227),
(296, 12, 36, 'CIF Power & Shine Kitchen Spray 700 ml (Green)_03_04_2017_CIF Power & Shine Kitchen Spray 700 ml green1.jpg', 'CIF Power & Shine Kitchen Spray 700 ml (Green)', 'The product in display is a kitchen cleaners and is green in color. Its item form is spray and the package contains 1 bottle\r\n\r\n', 'CIF Power & Shine Kitchen Spray 700 ml (Green)\r\n', '700', '25', 'ML', 'BOTTLE', 499, 0, 499),
(297, 31, 60, 'Sunsilk Nourishing Soft and Smooth Shampoo 340ml_03_04_2017_Sunsilk Nourishing Soft and Smooth Shampoo1, 340ml.jpg', 'Sunsilk Nourishing Soft and Smooth Shampoo  340ml', 'Due the harsh sun the hair is stripped off its essential oils, leaving it dry. Sunsilk Dream Soft & Smooth shampoo is the best shampoo for dry hair. It is enriched with Egg Ceramide Complex, which cleanses your hair and conditions even the driest hair leaving it soft & smooth.\r\n\r\n', 'Sodium Laureth Sulphate, Silicone , Ultra Light Fusion Of 5 Natural Oils\r\n\r\n\r\n', '340', '25', 'ML', 'BOTTLE', 195, 0, 195),
(298, 31, 60, 'Sunsilk Hairfall Solution Shampoo, 340ml_03_04_2017_Sunsilk Hairfall Solution Shampoo_340ml.jpg', 'Sunsilk Hairfall Solution Shampoo, 340ml', 'Try Sunsilk hairfall solution. It has been cocreated by Dr. Francesca fusco and is enriched with soya vitamin complex which deeply nourishes and conditions your hair while thoroughly reinforcing the tresses from root to tip. This strengthens your hair, thus reducing hair breakage. So say no to hair breakage and yes to happy days.\r\n\r\n', 'Sodium Laureth Sulphate, Silicone, Soya Vitamin Complex\r\n\r\n', '340', '25', 'ML', 'BOTTLE', 200, 0, 200),
(299, 31, 60, 'Sunsilk Stunning Black Shine Shampoo, 650ml_03_04_2017_Sunsilk Stunning Black Shine Shampoo, 650ml.jpg', 'Sunsilk Stunning Black Shine Shampoo, 650ml', 'This Stunning Black Shine Shampoo from Sunsilk lends a distinctive shine to your hair. It has been co-created with hair expert Jamal Hammadi and contains an Amla Pearl complex that nourishes your hair from root to tip and gives it a healthy glow. You can use this shampoo with a Black Shine conditioner for best results. Wash and nourish your hair with its advanced formula and maintain your hairs black sheen, every day. ', 'Sodium Laureth Sulphate, Silicone, Amla Pearl Complex\r\n\r\n', '650', '24', 'ML', 'BOTTLE', 365, 15, 310),
(300, 31, 60, 'Sunsilk Shampoo - Perfect Straight, 650 ml_04_04_2017_Sunsilk Perfect Straight Shampoo, 650ml.jpg', 'Sunsilk Shampoo - Perfect Straight, 650 ml', 'Sunsilks new Perfect Straight Shampoo uses the breakthrough Straight-Lock Technology to give you silky, smooth, and straight hair. The special molecules present in it have an advanced formula that penetrate deep into your hair fibers to reduce frizz and help straighten hair strands. The shampoo controls each wet hair strand and aligns them evenly as your hair dries. Get beautiful, straight hair every day with this Perfect Straight shampoo from Sunsilk. Co-created with Sunsilk expert Yuko Yamashita, Sunsilk Perfect Straight Shampoo is the ideal shampoo to get straight, luscious, tangle-free hai', '\r\nSodium Laureth Sulphate, Silicone, Straight Lock Technology\r\n\r\n', '650', '25', 'ML', 'BOTTLE', 349, 15, 297),
(301, 31, 60, 'Sunsilk Conditioner - Lusciously Thick & Long Nourishing, 180 ml_04_04_2017_sunsilk-conditioner-lusciously-thick-long-nourishing-180ml.jpg', 'Sunsilk Conditioner - Lusciously Thick & Long Nourishing, 180 ml', 'The Sunsilk Lusciously Thick and Long Conditioner has been co-created with Teddy Charles. It nourishes and conditions your hair making them smooth and luscious and it protects your hair from sun damage and leaves them touchably soft and flake free. Get 2X thicker hair with natural body and bounce! Buy the Sunsilks Lusciously Thick and Long Conditioner in this 180 ml tube for evenly thick looking, healthy hair all the way to the tips!', 'Ceteary Alcohol, Behentrimonium Chloride, Keratin Yogurt Nutria Complex\r\n\r\n', '180', '25', 'ML', 'TUBE', 146, 0, 146),
(302, 33, 60, 'TRESemme Shampoo - Split Remedy, 580 ml_14_04_2017_tresemme-shampoo-split-remedy-580ml.jpg', 'TRESemme Shampoo - Split Remedy, 580 ml', 'Let split ends be a thing of the past with the Tresemme Split Remedy Shampoo! This nourishing shampoo is fortified with a blend of vitamins to give you healthy, strong hair. This unique combination helps to nurture your hair from within. It restores their natural health and shine and its advanced formula reaches the deepest roots to nourish your damaged hair with its Amino-Vitamin blend formula. It eliminates split ends giving you healthy, bouncy and shiny hair. Use this effective Split Remedy Shampoo from Tresemme regularly for dazzling locks. Buy this large bottle and watch your hair look al', '\r\nSodium Laureth Sulphate, Silicone, Amino Vitamin Blend\r\n\r\n', '580', '22', 'ML', 'BOTTLE', 415, 15, 353),
(304, 97, 72, 'Fresho Rohu Fish Curry Cut/Bengali Cut, 500 g With Head_08_03_2023_fish.png', 'Fresho Rohu Fish Curry Cut/Bengali Cut, 500 g With Head', 'Rohu fish with head & tail pieces is rich in protein and low in fat. It also contains plenty of minerals such as zinc, iron, and calcium, and has an abundance of omega-3 fatty acids. Vitamins such as A and D are also present. This fish helps increase the \"absorption rate\", boosts immunity and has anti-inflammatory properties. It also enhances the skin, nails, and hair, regulates blood sugar, and prevents cardiovascular disease. ', 'Rohu fish with head & tail pieces is rich in protein and low in fat. It also contains plenty of minerals such as zinc, iron, and calcium, and has an abundance of omega-3 fatty acids. Vitamins such as A and D are also present. This fish helps increase the \"absorption rate\", boosts immunity and has anti-inflammatory properties. It also enhances the skin, nails, and hair, regulates blood sugar, and prevents cardiovascular disease. ', '500', '2499', 'GRAM', 'POUCH', 250, 26, 185),
(305, 97, 71, 'Fresho Chicken - Curry Cut Without Skin, Antibiotic Residue Free, 12-16 Pcs, 500 g_08_03_2023_chicken.png', 'Fresho Chicken - Curry Cut Without Skin, Antibiotic Residue Free, 12-16 Pcs, 500 g', 'hicken is a lean meat with various health benefits. Packed with nutritional values, chicken is supremely advantageous for your body. Filled with vitamins, minerals and protein, chicken promotes brain development, strengthens your bones, aids in weight loss, builds muscle and helps in a healthy heart. ', 'hicken is a lean meat with various health benefits. Packed with nutritional values, chicken is supremely advantageous for your body. Filled with vitamins, minerals and protein, chicken promotes brain development, strengthens your bones, aids in weight loss, builds muscle and helps in a healthy heart. ', '500', '2498', 'GRAM', 'POUCH', 200, 25, 150),
(306, 97, 70, 'Fresho Farm Eggs - Brown, Medium, Antibiotic Residue-Free, 10 pcs_08_03_2023_egg.png', 'Fresho Farm Eggs - Brown, Medium, Antibiotic Residue-Free, 10 pcs', 'Eggs are one of the common food items in most of the households. From breakfast to dinner, eggs are indulged in various ways. Poached, boiled, fried; we all have our own favourite choices. Not only are they delicious, but they are also crammed with health benefits. It is one of the most in-expensive sources of high protein. ', 'Eggs are one of the common food items in most of the households. From breakfast to dinner, eggs are indulged in various ways. Poached, boiled, fried; we all have our own favourite choices. Not only are they delicious, but they are also crammed with health benefits. It is one of the most in-expensive sources of high protein. ', '10', '22', 'PCS', 'CARTON', 250, 20, 200);
