(1, 'GMART_27_02_2023_3637713-247.png', 'GMART', 'Gmart grocery store is a retail store that sells food and household items. It usually has a variety of sections, including fresh produce, dairy, meat, bakery, and frozen foods. In addition to food items, grocery stores may also sell household essentials like cleaning supplies, toiletries, and pet food. Some grocery stores also have a pharmacy or a section dedicated to health and wellness products. Many grocery stores offer additional services such as online ordering, home delivery, and in-store pickup to provide customers with a convenient shopping experience. The products and services offered', 'Shop No. 12, ', 'Jaldhara Chowkdi', 'Ankleshwar', 'Gujarat', 'info@gmart.com', '1800 2233 4445', 'https//www.gmart.com');
